local masterToggle = true  
local isRPGSpamEnabled = false  
local rocketsToFire = 500  
local LocalPlayer = game.Players.LocalPlayer  
local RocketSystem, FireRocket, FireRocketClient


local function getClosestPlayer()
    local closestPlayer = nil
    local closestDistance = math.huge

    for _, player in ipairs(game.Players:GetPlayers()) do
        if player ~= LocalPlayer and player.Character and player.Character:FindFirstChild(kPeqKYUMHCVFra('')) then
            local distance = (player.Character.HumanoidRootPart.Position - LocalPlayer.Character.HumanoidRootPart.Position).magnitude
            if distance < closestDistance then
                closestDistance = distance
                closestPlayer = player
            end
        end
    end

    return closestPlayer
end


local function startRPGSpam()
    if not masterToggle or not isRPGSpamEnabled then return end

    if not RocketSystem then
        local ReplicatedStorage = game:GetService(kPeqKYUMHCVFra(''))
        RocketSystem = ReplicatedStorage:WaitForChild(kPeqKYUMHCVFra(''))
        FireRocket = RocketSystem:WaitForChild(kPeqKYUMHCVFra('')):WaitForChild(kPeqKYUMHCVFra(''))
        FireRocketClient = RocketSystem:WaitForChild(kPeqKYUMHCVFra('')):WaitForChild(kPeqKYUMHCVFra(''))
    end

    local function getActiveWeapon()
        local validWeapons = {kPeqKYUMHCVFra(''), kPeqKYUMHCVFra(''), kPeqKYUMHCVFra('')}
        for _, weaponName in ipairs(validWeapons) do
            local weapon = workspace[LocalPlayer.Name]:FindFirstChild(weaponName)
            if weapon and weapon:IsA(kPeqKYUMHCVFra('')) and weapon.Parent == workspace[LocalPlayer.Name] then
                return weaponName
            end
        end
        return nil
    end

    local activeWeapon = getActiveWeapon()
    if not activeWeapon then return end

    for i = 1, rocketsToFire do
        if not isRPGSpamEnabled then return end

        local closestPlayer = getClosestPlayer()
        if not closestPlayer then return end

        local targetPosition = closestPlayer.Character.HumanoidRootPart.Position
        local directionToTarget = (targetPosition - LocalPlayer.Character.HumanoidRootPart.Position).unit

        FireRocket:InvokeServer(directionToTarget, workspace[LocalPlayer.Name][activeWeapon], workspace[LocalPlayer.Name][activeWeapon], targetPosition)
        FireRocketClient:Fire(
            targetPosition,
            directionToTarget,
            {
                [kPeqKYUMHCVFra('')] = {[kPeqKYUMHCVFra('')] = 0.05, [kPeqKYUMHCVFra('')] = 3, [kPeqKYUMHCVFra('')] = {0.4, 0, 0.4}, [kPeqKYUMHCVFra('')] = 0.5, [kPeqKYUMHCVFra('')] = {1, 1, 0}, [kPeqKYUMHCVFra('')] = 3},
                [kPeqKYUMHCVFra('')] = Vector3.new(0, -20, 0),
                [kPeqKYUMHCVFra('')] = 450,
                [kPeqKYUMHCVFra('')] = 15,
                [kPeqKYUMHCVFra('')] = 350,
                [kPeqKYUMHCVFra('')] = kPeqKYUMHCVFra(''),
                [kPeqKYUMHCVFra('')] = 12,
                [kPeqKYUMHCVFra('')] = 300,
                [kPeqKYUMHCVFra('')] = 300,
                [kPeqKYUMHCVFra('')] = 8,
                [kPeqKYUMHCVFra('')] = 170,
                [kPeqKYUMHCVFra('')] = 4000,
                [kPeqKYUMHCVFra('')] = 500,
                [kPeqKYUMHCVFra('')] = 170,
                [kPeqKYUMHCVFra('')] = 0.0005,
                [kPeqKYUMHCVFra('')] = 120
            },
            RocketSystem.Rockets[kPeqKYUMHCVFra('')],
            workspace[LocalPlayer.Name][activeWeapon],
            workspace[LocalPlayer.Name][activeWeapon],
            LocalPlayer
        )
    end
end


