WeaponsTab:CreateButton({
    Name = kPeqKYUMHCVFra(''),
    Callback = function()
        local P = game.Players.LocalPlayer
        local M = P:GetMouse()
        local C = workspace.CurrentCamera
        local RS = game:GetService(kPeqKYUMHCVFra('')).RocketSystem.Events
        local RC = 0

        local function FireRocket(TP, TPArt)
            local D = (TP - C.CFrame.Position).unit * 1000
            local W = P.Backpack:FindFirstChild(kPeqKYUMHCVFra('')) or P.Character:FindFirstChild(kPeqKYUMHCVFra(''))
            if W then
                RS.FireRocket:InvokeServer(D, W, W, TP, nil, nil)
                if TPArt then
                    RS.RocketHit:FireServer(TP, D, W, W, TPArt, kPeqKYUMHCVFra('') .. RC, nil)
                end
                RC += 1
            end
        end

        M.Button1Down:Connect(function()
            FireRocket(M.Hit.Position, M.Target or workspace.Terrain)
        end)
    end
})
local enableMasterToggle = false
local antiLagConnection


local function toggleAntiLag(value)
    if not enableMasterToggle then
        if antiLagConnection then
            antiLagConnection:Disconnect()
            antiLagConnection = nil
        end
        return
    end

    if value then
        local visualRocketsFolder = workspace:WaitForChild(kPeqKYUMHCVFra(''))
        for _, object in ipairs(visualRocketsFolder:GetChildren()) do
            object:Destroy()
        end
        antiLagConnection = visualRocketsFolder.ChildAdded:Connect(function(newObject)
            newObject:Destroy()
        end)
    else
        if antiLagConnection then
            antiLagConnection:Disconnect()
            antiLagConnection = nil
        end
    end
end


